INSERT INTO `wp_posts` VALUES (2,1,'2019-06-12 07:34:36','2019-06-12 07:34:36','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"https://demo.themecentury.com/wpthemes/hamroclass/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','open','','sample-page','','','2019-06-12 07:34:36','2019-06-12 07:34:36','',0,'https://demo.themecentury.com/wpthemes/hamroclass/?page_id=2',0,'page','',0),(3,1,'2023-05-12 05:46:15','2023-05-12 05:46:15','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: https://adlineschool.com/cbse.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where your data is sent</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2023-05-12 05:46:15','2023-05-12 05:46:15','',0,'https://adlineschool.com/cbse/?page_id=3',0,'page','',0),(5,1,'2023-05-12 05:49:38','2023-05-12 05:49:38','','Checkout','','publish','closed','closed','','lp-checkout','','','2023-05-12 05:49:38','2023-05-12 05:49:38','',0,'https://adlineschool.com/cbse/lp-checkout/',0,'page','',0),(6,1,'2023-05-12 05:49:38','2023-05-12 05:49:38','<!-- wp:shortcode -->[learn_press_profile]<!-- /wp:shortcode -->','Profile','','publish','closed','closed','','lp-profile','','','2023-05-12 05:49:38','2023-05-12 05:49:38','',0,'https://adlineschool.com/cbse/lp-profile/',0,'page','',0),(7,1,'2023-05-12 05:49:38','2023-05-12 05:49:38','','All Courses','','publish','closed','closed','','courses','','','2023-05-12 05:49:38','2023-05-12 05:49:38','',0,'https://adlineschool.com/cbse/courses/',0,'page','',0),(8,1,'2023-05-12 05:49:38','2023-05-12 05:49:38','','Become A Teacher','','publish','closed','closed','','lp-become-a-teacher','','','2023-05-12 05:49:38','2023-05-12 05:49:38','',0,'https://adlineschool.com/cbse/lp-become-a-teacher/',0,'page','',0),(9,1,'2023-05-12 05:49:38','2023-05-12 05:49:38','','Term Conditions','','publish','closed','closed','','lp-term-conditions','','','2023-05-12 05:49:38','2023-05-12 05:49:38','',0,'https://adlineschool.com/cbse/lp-term-conditions/',0,'page','',0),(11,1,'2019-06-14 22:04:17','2019-06-14 22:04:17','<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p><strong>Adline Group Of Schools at situated in the heart of Caldwell colony Villukuri near Thuckalay at the District of Kanyakumari, Tamil Nadu, South India. The school runs KG to 12th standard for the last 32 years of academic excellence. For any questions contact us via our suppor</strong>t.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:shortcode -->\n[contact-form-7 id=\"74\" title=\"Contact form 1\"]\n<!-- /wp:shortcode --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3948.8121900084707!2d77.34441187391539!3d8.22163380110636!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3b04f9bb03b520a9%3A0x8dc5b269b380d37!2sAdline%20Group%20Of%20Schools!5e0!3m2!1sen!2sin!4v1684578647306!5m2!1sen!2sin\" width=\"600\" height=\"300\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p><strong>For more information use the information below</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p>\n<i class=\"fa fa-phone\" style=\"font-size:24px\"></i>\nPhone</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p><strong><a href=\"tel:+91 9788237171\">+91 9788237171</a>, 04651 258 187, 04651 258 947.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p>\n<i class=\"fa fa-envelope-square\" style=\"font-size:24px\"></i>\nEmail</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p><a href=\"mailto:adlineschool@gmail.com\"><strong>adlineschool@gmail.com</strong></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p>\n<i class=\"fa fa-map-marker\" style=\"font-size:24px\"></i>\nAddress</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p><strong>Adline Group Of Schools,Adline Street,Kuzhumaikadu Villukuri OP,</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>629180 Kanyakumari Dist Tamilnadu, India.</strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->','Contact Us','','publish','closed','closed','','contact','','','2023-05-20 11:43:39','2023-05-20 11:43:39','',0,'https://demo.themecentury.com/wpthemes/hamroclass/?page_id=11',0,'page','',0),(12,1,'2019-06-14 22:04:17','2019-06-14 22:04:17','<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p><em>Our school provides a wide range of educational opportunities that put a world-class education within your reach.</em> The school runs KG to 12th standard for the last 32 years of academic excellence.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em>Our humanistic approach equips students with the energy they need to embrace challenge, enjoy learning, and conserve the earth\'s resources. In order to provide comprehensive teaching-learning experiences, our eclectic program combines the best curricular approaches. Our goal is to create people who are imaginative, collaborative, flexible, and resilient.</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em>Children develop into free people who give their lives meaning and purpose through a journey of creativity, imagination, and self-discovery. We warmly invite you to explore our world of joyful and endless learning!</em> .<em>We look forward to continuing to serve and keeping you updated on our progress.</em></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":1698,\"width\":403,\"height\":226,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full is-resized\"><img src=\"https://adlineschool.com/cbse/wp-content/uploads/2023/05/adline-school.jpg\" alt=\"\" class=\"wp-image-1698\" width=\"403\" height=\"226\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->','About US','','publish','closed','closed','','about-us','','','2023-05-29 10:25:45','2023-05-29 10:25:45','',0,'https://demo.themecentury.com/wpthemes/hamroclass/?page_id=12',0,'page','',0),(22,1,'2019-06-20 07:02:38','2019-06-20 07:02:38','<!-- wp:heading -->\n<h2> Provided by The University of Maryland, College Park (UMD), University System of Maryland (USMx) </h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>What you will learn</h3>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Marketing methods to help you identify successful strategies and tactics</li><li>How to apply marketing frameworks to real-world business problems</li><li>How to create strategic, research-based marketing plans</li><li>How marketing skill sets support your role as a successful mananger/leader&nbsp;</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Overview</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>\nMark Cuban, owner of the Dallas Mavericks, puts it bluntly: “No sales.\nNo company.” Every organization needs effective marketing to match its\nproducts, services and experiences to customers, and maintain and grow\nits revenue. In this course you will learn the keys to successful\nmarketing, from using traditional and digital media channels to build\nbrand awareness, to using consumer and behavioral research in order to\nbetter match your product to your customers’ wants and needs. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In this course, you\'ll learn to:<br /></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Identify target customers and analyze and understand their needs and desires.</li><li>Define your offering\'s value proposition and positioning.</li><li>Identify the right target customer segment, and create a go-to-market strategy and integrated marketing campaign</li><li>Define key performance indicators and analyze the results.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p> By the end of this class, you will understand how to assess the  competitive playing field, understand your competitor’s brand position,  and map your own organization’s position, strengths, and weaknesses, to  create or capture competitive advantages. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Who can take this course?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Unfortunately, learners from one or more of the following countries or regions will not be able to register for this course: Iran, Cuba and the Crimea region of Ukraine. While edX has sought licenses from the U.S. Office of Foreign Assets Control (OFAC) to offer our courses to learners in these countries and regions, the licenses we have received are not broad enough to allow us to offer this course in all locations. EdX truly regrets that U.S. sanctions prevent us from offering all of our courses to                 everyone, no matter where they live. </p>\n<!-- /wp:paragraph -->','Child management and learning process','','publish','open','open','','child-management-and-learning-process','','','2019-06-20 07:02:38','2019-06-20 07:02:38','',0,'https://demo.themecentury.com/wpthemes/hamroclass/?p=22',0,'post','',0),(24,1,'2019-06-20 07:05:05','2019-06-20 07:05:05','<!-- wp:heading -->\n<h2>What you will learn</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>To apply core methodologies (probability, statistics, optimization) used in supply chain modeling and analysis.</li><li>To understand and use fundamental models to make trade-offs between forecasting, inventory, and transportation.</li><li>To design supply chain networks as well as financial and information flows.</li><li>To understand how supply chains act as systems and interact.</li><li>How technology is used within supply chains from fundamentals to packaged software systems.</li><li>End to end supply chain management.</li></ul>\n<!-- /wp:list -->','Advance your career in Supply Chain Management','','publish','open','open','','advance-your-career-in-supply-chain-management','','','2019-06-20 07:05:05','2019-06-20 07:05:05','',0,'https://demo.themecentury.com/wpthemes/hamroclass/?p=24',0,'post','',0),(26,1,'2019-06-20 07:07:09','2019-06-20 07:07:09','<!-- wp:paragraph -->\n<p>Master and apply the core methodologies used in\nsupply chain analysis and modeling, including statistics, regression,\noptimization and probability ​– part of the <em>MITx Supply Chain Management MicroMasters Credential</em>.Start Date:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Before you start</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 id=\"prerequisites\">Prerequisites</h4>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Secondary school algebra and basic mathematics concepts</li><li>Passing knowledge of statistics and probability</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Course opens: Mar 27, 2019Course ends: Jul 9, 2019</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>What you will learn</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Basic analytical methods</li><li>How to apply basic probability models</li><li>Statistics in supply chains</li><li>Formulating and solving optimization models</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>Overview</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Supply\n chains are complex systems involving multiple businesses and\norganizations with different goals and objectives. Many different\nanalytical methods and techniques are used by researchers and\npractitioners alike to better design and manage their supply chains.\nThis business and management course introduces the primary methods and\ntools that you will encounter in your study and practice of supply\nchains. We focus on the application of these methods, not necessarily\nthe theoretical underpinnings.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We will begin with an overview of introductory probability and\ndecision analysis to ensure that students understand how uncertainty can\n be modeled. Next, we will move into basic statistics and regression.\nFinally, we will introduce optimization modeling from unconstrained to\nlinear, non-linear, and mixed integer linear programming.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This is a hands-on course. Students will use spreadsheets extensively  to apply these techniques and approaches in case studies drawn from  actual supply chains<strong>.<br /><br />This course is part of a  MicroMasters program. If you complete all courses in the MicroMasters  program in 2018, GE will guarantee you an interview in Boston for an  internship or full-time role. Open to Massachusetts residents only.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Frequently asked questions</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><em>MITx  requires individuals who enroll in its courses on edX to abide by the  terms of the edX honor code. MITx will take appropriate corrective  action in response to violations of the edX honor code, which may  include dismissal from the MITx course; revocation of any certificates  received for the MITx course; or other remedies as circumstances  warrant. No refunds will be issued in the case of corrective action for  such violations.</em><br /><br /><strong>MITx MicroMasters Credential in Supply Chain Management</strong><br /><br /> The MITx MicroMasters Credential in Supply Chain Management is  specifically designed and administered by MIT’s Center for  Transportation &amp; Logistics (CTL) to teach the critical skills needed  to be successful in this exciting and growing field. In addition to  being a standalone certificate demonstrating expertise in the field,  students who complete all of the required courses and the final  proctored exam will be qualified to apply to gain credit at MIT for the  blended graduate master\'s degree program. In order to qualify for the  MITx MicroMasters Credential in Supply Chain Management you need to earn  a Verified Certificate in all of the required courses. When you  register for a Verified Certificate you will also be granted access to  additional practice problems, supplemental readings, and opportunities  for increased interaction with the faculty and teaching staff.<br /></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Who can take this course?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Unfortunately, learners from one or more of the following countries or regions will not\n                be able to register for this course: Iran, Cuba and the Crimea region of Ukraine.\n                While edX has sought licenses from the U.S. Office of Foreign Assets Control (OFAC) to\n                offer our courses to learners in these countries and regions, the licenses we have\n                received are not broad enough to allow us to offer this course in all locations. EdX\n                truly regrets that U.S. sanctions prevent us from offering all of our courses to\n                everyone, no matter where they live.</p>\n<!-- /wp:paragraph -->','Childrens are learning','','publish','open','open','','childrens-are-learning','','','2019-06-20 07:07:09','2019-06-20 07:07:09','',0,'https://demo.themecentury.com/wpthemes/hamroclass/?p=26',0,'post','',0),(28,1,'2019-06-20 07:13:19','2019-06-20 07:13:19','<!-- wp:heading {\"level\":3} -->\n<h3>About this course</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Il nostro patrimonio culturale è un bene prezioso, a volte poco  valorizzato. Molti sono i luoghi che, sebbene ricchi di storia e  cultura, sono stati a lungo dimenticati ma poi riscoperti e valorizzati.<br /><br />Questo  corso mette in campo le competenze per rivalutare i siti storici ed  affrontare processi di ri-funzionalizzazione del patrimonio culturale ed  ambientale. <br /><br />L\'attenzione si concentra sul fenomeno  dell\'innovazione sociale applicata al patrimonio culturale. Sono  illustrate storie emblematiche che in questi anni si sono sviluppate nel  Sud d’Italia, delineando le peculiarità di questo nuovo modello di  gestione che rappresenta un\'alternativa tra il modello pubblico e quello  privato.<br /><br />Attraverso approfondimenti e studi di caso potrai  verificare le competenze acquisite per riuscire ad operare al meglio  nelle imprese, negli enti e nelle associazioni nelle quali può essere  impiegato. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Social innovation and the cultural heritage</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Our  cultural heritage is a huge asset that is often undervalued. There are  many examples of long-forgotten places, rich in history and culture,  which have been rediscovered and have gained new value.<br /><br />This  course provides learners with the skills to evaluate national cultural  and environmental sites, and implement repurposing projects for their  renewal.<br /><br />The focus is on the phenomenon of social innovation  applied to our cultural heritage. Flagship projects that have developed  in recent years in Southern Italy are presented, highlighting the new  management model they use: an alternative to the current public or  private models. <br /><br />Case studies and exercises will enable you to  test out your newly-acquired skills, preparing you for work in the kind  of company, association or organization that recruits this skills  profile.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>What you\'ll learn</h3>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Gestire problematiche di tipo organizzativo nel settore dei beni culturali</li><li>Conoscere le fasi del processo di progettazione organizzativa</li><li>Sviluppare capacità organizzative utili per il tuo lavoro</li><li>Comprendere i meccanismi di funzionamento delle strutture organizzative</li><li>Meccanismi di gestione e coordinamento</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>How to deal with management/organizational issues in the Cultural Heritage sector</li><li>Understand different stages in business planning</li><li>Develop organizational skills for the workplace</li><li>Understand organizational structures and how they work</li><li>Management mechanisms and coordination</li></ul>\n<!-- /wp:list -->','L&#039;innovazione sociale per il patrimonio culturale','','publish','open','open','','linnovazione-sociale-per-il-patrimonio-culturale','','','2019-06-20 07:13:19','2019-06-20 07:13:19','',0,'https://demo.themecentury.com/wpthemes/hamroclass/?p=28',0,'post','',0),(30,1,'2019-06-20 07:16:38','2019-06-20 07:16:38','<!-- wp:heading -->\n<h2>About this course</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>El curso proporcionará, desde cero, herramientas teóricas y\ntécnicas para emplear la fotografía como documento que forma parte de la\n investigación en las ciencias sociales, artes y las humanidades. No\nobstante, el campo es mucho más amplio en cuanto desarrollan capacidades\n interpretativas y creativas de la fotografía. Es así como se considera\nque el curso une un desenvolvimiento en torno la semiótica, la técnica,\nla teoría y el uso de la fotografía con fines documentales. <br /><br />&nbsp;Al\nterminar el curso, los estudiantes aprenderán el concepto de fotografía\ndocumental, conocerán la formar de sacar provecho a la cámara y lograrán\n dar sentido a la fotografía como documento reflejado en la creación de\nun proyecto de fotografía documental, a través de actividades prácticas y\n videos con expertos en el campo, con el propósito&nbsp; de enriquecer su\nforma de interpretar el mundo a través de la fotografía.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>What you\'ll learn</h3>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Conocimientos básicos sobre fotografía</li><li>Desarrollar de creatividad fotográfica</li><li>Compresión de cómo se forma la fotografía</li><li>Uso de la fotografía en proyectos corporativos o personales que responden a preguntas de investigación social</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Course Syllabus</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Reconocimiento de la fotografía documental</li><li>Elementos de la fotografía documental</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>Sección 2 Conociendo el instrumento de trabajo</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Aspectos técnicos de la cámara</li><li>Practicando con los elementos técnicos</li><li>Tipos de cámara</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>Sección 3 Acción política de la imagen</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Interpretando imágenes desde la semiótica</li><li>Construyendo identidad</li><li>Fotografía en la historia</li><li>La fotografía como documento</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>Sección 4 El lenguaje fotográfico</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Hablemos de composición</li><li>Construir imágenes interesantes</li><li>Profundidad de campo y bokeh</li><li>Saca provecho de las formas</li><li>Fotografía en movimiento</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Frequently Asked Questions</h3>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>¿Necesito una cámara profesional? Necesitas una cámara digital que tenga opciones de configuración manual.</li><li>¿Qué tipo de cámara recomiendan? Se recomienda ampliamente la utilización de una cámara réflex.</li><li>¿Necesito trabajar en una compañía para tomar el curso? No, está dirigido a todo público que tenga interés en la fotografía</li><li>¿Cuál es la edad mínima para tomar el curso? 16 años</li><li>¿Cómo logro una buena composición? Aplicando ley de tercios y Ley de mirada</li><li>¿Cómo puedo editar mis fotos? A través de aplicaciones gratuitas o programas especializados como photoshop o lightroom</li><li>¿En qué formato debo guardar las fotos? El formato depende del uso,\nsi no es un uso especializado, jpg es el ideal, de lo contrario el\nformato raw será el indicado.</li><li>¿Qué necesito antes de salir a tomar fotos? Tener información del\nsitio a dónde me dirijo, así como las condiciones técnicas de mi cámara:\n duración de batería, capacidad de memoria, etc., y chequear las\ncondiciones climáticas.</li><li>¿Cómo hago para dejar de tomar fotos aburridas o comunes? Aplicando\nplanos y ángulos corrientes, pero también innovando desde mi punto de\nvista y experimentando nuevas formas de ver al sujeto.</li><li>¿Qué es un plano fotográfico? El plano fotográfico es la distancia y\n encuadre estándar que se emplean en la fotografía, hay diferentes tipos\n y usos.</li><li>¿Qué es un objetivo fotográfico?Comúnmente se conoce como un\nconjunto de lentes que tiene un uso específico, según su distancia\nfocal; generalmente en las cámaras réflex son intercambiables.</li><li>¿Qué es la temperatura fotográfica? La temperatura fotográfica es la\n sensación térmica que le puedo dar al ambiente que estoy fotografiando,\n que puede ser o muy fría o muy caliente, se expresa en grados kelvin.</li><li>¿Qué es el histograma? Es un mapa de la composición de pixeles claros y oscuros que tiene una fotografía.</li><li>¿Cómo lograr la impresión de movimiento en las fotos? Ajustando la\nvelocidad para que el sujeto quede en movimiento, pero el ambiente quede\n estático.</li><li>¿Cómo gradúo la entrada de luz a la cámara? A través de la manipulación del parámetro del diafragma o la velocidad.</li></ul>\n<!-- /wp:list -->','Fundamentos de fotografía documental','','publish','open','open','','fundamentos-de-fotografia-documental','','','2019-06-20 07:16:38','2019-06-20 07:16:38','',0,'https://demo.themecentury.com/wpthemes/hamroclass/?p=30',0,'post','',0),(32,1,'2019-06-20 07:18:37','2019-06-20 07:18:37','<!-- wp:heading -->\n<h2>About this course</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Public libraries are becoming dynamic hubs for learning, civic engagement, and community.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This course will discuss strategies for gathering statistical and\ndescriptive data about public library communities. Learners will\nidentify local partners in education, social services, government\nagencies, and more.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>While conducting real-world investigations, learners will gain deeper\n insight into the wants and needs of community organizations. This will\nempower learners to make better management decisions to address those\nneeds, even in libraries with limited budgets.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>What you\'ll learn</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>● How to find demographic and persona data from online sources;<br />● To conduct environmental scans;<br />● How to lead focus groups and interviews;<br />● How to analyze data to find patterns, overlaps, and gaps in available community services;<br />● To synthesize your findings in a report.</p>\n<!-- /wp:paragraph -->','Identifying Community Needs for Public Library Management','','publish','open','open','','identifying-community-needs-for-public-library-management','','','2019-06-20 07:18:37','2019-06-20 07:18:37','',0,'https://demo.themecentury.com/wpthemes/hamroclass/?p=32',0,'post','',0),(48,1,'2019-06-20 08:06:21','2019-06-20 08:06:21','.learn-press-breadcrumb{\n	display:none;\n}\n\n.widget.hamroclass_course_search_widget{\n	padding:0;\n}','hamroclass','','publish','closed','closed','','hamroclass','','','2023-05-12 05:53:11','2023-05-12 05:53:11','',0,'https://demo.themecentury.com/wpthemes/hamroclass/2019/06/20/hamroclass/',0,'custom_css','',0),(50,1,'2019-06-26 10:55:59','2019-06-26 10:55:59','','ceremony-3058283_1920','','inherit','open','closed','','ceremony-3058283_1920','','','2019-06-26 10:55:59','2019-06-26 10:55:59','',0,'https://adlineschool.com/cbse/wp-content/uploads/2019/06/ceremony-3058283_1920.jpg',0,'attachment','image/jpeg',0),(51,1,'2019-06-26 10:56:01','2019-06-26 10:56:01','','kids-2985782_1920','','inherit','open','closed','','kids-2985782_1920','','','2019-06-26 10:56:01','2019-06-26 10:56:01','',0,'https://adlineschool.com/cbse/wp-content/uploads/2019/06/kids-2985782_1920.jpg',0,'attachment','image/jpeg',0),(52,1,'2019-06-26 10:56:03','2019-06-26 10:56:03','','library-1147815_1920','','inherit','open','closed','','library-1147815_1920','','','2019-06-26 10:56:03','2019-06-26 10:56:03','',0,'https://adlineschool.com/cbse/wp-content/uploads/2019/06/library-1147815_1920.jpg',0,'attachment','image/jpeg',0),(53,1,'2019-06-26 10:56:05','2019-06-26 10:56:05','','notebook-336634_1920','','inherit','open','closed','','notebook-336634_1920','','','2019-06-26 10:56:05','2019-06-26 10:56:05','',0,'https://adlineschool.com/cbse/wp-content/uploads/2019/06/notebook-336634_1920.jpg',0,'attachment','image/jpeg',0),(54,1,'2019-06-26 10:56:07','2019-06-26 10:56:07','','team-3373638_1920','','inherit','open','closed','','team-337363