arns its best score in the academic reputation indicator, and also  achieves a strong score for its proportion of international students,  making it a diverse place to study.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>9.&nbsp;University of Chicago</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The <a href=\"https://www.topuniversities.com/student-info/qs-guides/how-study-abroad-us\">US</a>’\n University of Chicago retains its position of ninth in the world in\n2019, with a particularly high score for its reputation among academics.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>8.&nbsp;Imperial College London</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Imperial is ranked eighth in the world this year and&nbsp;is now&nbsp;London’s\nhighest-ranked university. Like UCL, it boasts an excellent score for\nthe international students indicator, meaning you’ll be in good company\nif you study at either university as an international student.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>7.&nbsp;ETH Zurich (Swiss Federal Institute of Technology)</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Switzerland’s  ETH Zurich is the highest-ranked university in continental Europe and  climbed three places in this year’s ranking, with its best score for  citations per faculty member, a measure of research impact.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>6.&nbsp;University of Cambridge</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The University of Cambridge slips one place in this year’s ranking\nbut does achieve higher scores than rival Oxford for its reputations\namong academics and employers, ranked second in the world for both after\n Harvard.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>5.&nbsp;University of Oxford</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The 2019 results see Oxford overtake Cambridge in our list of the\nworld\'s best universities, climbing one place to rank fifth in the world\n and first out of the UK’s 76 entries, with top-10 scores for its\nacademic and employer reputations as well as its faculty/student ratio.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>4.&nbsp;California Institute of Technology (Caltech)</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The smallest university in the top 10, Caltech retains its position\nof fourth in the world this year. Students benefit from an excellent\nstudent/faculty ratio, and Caltech also beats rival MIT in the citations\n per faculty member indicator, for which it’s ranked fifth in the world.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>3.&nbsp;Harvard University</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Harvard continues to rank third in the world as of the 2019 results\nbut remains first in the world for both employer and academic\nreputation.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>2.&nbsp;Stanford University</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Also retaining its position from last year is Stanford, which\nachieves its best scores for its reputation among academics and\nemployers (fifth for both).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>1.&nbsp;Massachusetts Institute of Technology (MIT)</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>And finally, MIT appears to be unbeatable as the world’s\nhighest-ranked university, holding on to the top spot for a record\nseventh year in a row this year. MIT also gets its highest scores for\nits reputations with academics and employers, at third and fourth\nrespectively.</p>\n<!-- /wp:paragraph -->','Top Universities in the World 2019','','publish','open','open','','top-universities-in-the-world-2019','','','2019-10-22 08:44:13','2019-10-22 08:44:13','',0,'https://demo.themecentury.com/wpthemes/hamroclass/?p=179',0,'post','',0),(180,1,'2019-10-22 08:44:06','2019-10-22 08:44:06','','hamroclass-education-is-the-most-powerfull-we